        super();
    }
    render(){ return(
            <div className="p-panel">
           <img src={this.props.settings}/> 
           <img src={this.props.mail}/>
        <img src={this.props.notify}/>
            <p className="ft">{this.props.name}</p>
             </div>
        );}



    }
export default ProfilePanel;
